        return (
            <Navbar bg="" expand="lg">
                <Navbar.Brand href="#home" >


                </Navbar.Brand>


                    <Nav className="mr-auto">
                        <Nav.Link href="/logIn">
                          Loggin

                        </Nav.Link>


                    </Nav>


            </Navbar>
        );
    }
}

export default Header;
